import axios from 'axios'
import React, { Component } from 'react'

export default class Left extends Component {
    constructor(){
        super();
        this.state={
            catdata:[]
        }
    }
    componentDidMount(){
        axios
        .get('https://fakestoreapi.com/products/categories')
        .then(res=>{
            console.log(res.data);
            this.setState({
                catdata:res.data
            })
        })
    }
  render() {
    const API = this.state.catdata;

    return (
      <div>
      <h1>Categories</h1>
      </div>
    )
  }
}
